

import unittest


def reverse_complement(pattern):
    complement = ''
    complements = {'A': 'T', 'T': 'A', 'G': 'C', 'C': 'G'}
    for i in range(len(pattern)):
        complement += complements[pattern[i]]
    return complement[::-1]


class TestReverseComplement(unittest.TestCase):

    def test_reverse_complement_0(self):
        pattern = 'AAAACCCGGT'
        output = 'ACCGGGTTTT'
        self.assertEqual(reverse_complement(pattern), output)

    def test_reverse_complement_1(self):
        pattern = ''
        output = ''
        self.assertEqual(reverse_complement(pattern), output)

    def test_reverse_complement_3(self):
        pattern = ''
        output = ''
        self.assertEqual(reverse_complement(pattern), output)


if __name__ == '__main__':
    unittest.main()
